import React from 'react'
import {data} from '../'

function Fixture() {
  return (
    <div>
        {
           data.map.groupA.matches( match => <div id={match.id}><p>{match.local} vs. {match.visitor}</p></div>)
        }

    </div>
  )
}

export default Fixture
